import Link from 'next/link';
import './index.css'

function LandingPageStyle() {
    let background = {
        backgroundColor: 'yellow',
    }
}

const LandingPage = () => (
    <div className="background" style={background}>
        <Link href="/dealer">
            <a>Dealer</a>
        </Link>
        <Link href="/customer">
            <a>Customer</a>
        </Link>
    </div>
);

export default LandingPage;
